import React from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import './style.scss';

const useStyles = makeStyles((theme) => ({
	root: {
	  flexGrow: 1,
	},
	paper: {
	  padding: theme.spacing(2),
	  textAlign: 'center',
	  color: theme.palette.text.secondary,
	},
  }));

  export const Dashboard = () => {
	const classes = useStyles();

	return (
	  <div className={classes.root}>
		<Grid container spacing={3}>
		  <Grid item xs>
			<Paper className={classes.paper}>Dịch vụ trả phí</Paper>
		  </Grid>
		  <Grid item xs>
			<Paper className={classes.paper}>Cửa hàng</Paper>
		  </Grid>
		  <Grid item xs>
			<Paper className={classes.paper}>Quảng cáo</Paper>
		  </Grid>
		</Grid>
		<Grid container spacing={3}>
		  <Grid item xs>
			<Paper className={classes.paper}>Gói tin</Paper>
		  </Grid>
		  <Grid item xs={6}>
			<Paper className={classes.paper}>Gói nạp tiền</Paper>
		  </Grid>
		  <Grid item xs>
			<Paper className={classes.paper}>Thành viên</Paper>
		  </Grid>
		</Grid>
	  </div>
	);
  }
